import React from 'react';
import '../styles/Home.css';
import sacbg from '../assets/sacbg.png'; 

function Home() {
    const SecondSlide = () => {
        const slideStyles = {
            container: {
                width: '100vw',
                height: '100vh',
                display: 'flex',
                position: 'relative',
                maxWidth: '100%',
            },
            backgroundImage: {
                width: '100%',
                height: '100%',
                position: 'absolute',
                zIndex: -1,
            },
            gridContainer: {
                width: '100%',
                height: '100%',
                display: 'grid',
                gridTemplateColumns: 'repeat(2, 1fr)',
                gridTemplateRows: 'repeat(2, 1fr)',
                gap: '10px',
                placeItems: 'center',
                zIndex: 10,
            },
            card: {
                background: 'linear-gradient(to bottom, slategray, gray)',
                borderRadius: '20px',
                boxShadow: '0 4px 20px rgba(0, 0, 0, 0.1)',
                transition: 'transform 0.3s ease-in-out, box-shadow 0.3s ease-in-out',
                display: 'flex',
                flexDirection: 'column',
                justifyContent: 'flex-end',
                padding: '1.5rem',
                color: 'white',
                fontFamily: 'Inter, sans-serif',
                fontSize: '1.1rem',
                cursor: 'pointer',
            },
            cardHover: {
                transform: 'scale(1.05)',
                boxShadow: '0 8px 40px rgba(0, 0, 0, 0.2)',
            },
            innerCard: {
                width: '100%',
                height: '14rem',
                backgroundColor: 'white',
                borderRadius: '20px',
                marginTop: '2rem',
            },
        };

        return (
            <div style={slideStyles.container}>
                <img
                    style={slideStyles.backgroundImage}
                    src={sacbg}
                    alt="Background"
                />
                <div style={slideStyles.gridContainer}>
                    <div
                        style={slideStyles.card}
                        onMouseEnter={e => e.currentTarget.style = { ...slideStyles.card, ...slideStyles.cardHover }}
                        onMouseLeave={e => e.currentTarget.style = slideStyles.card}
                    >
                        <div>see what events are happening in the school...</div>
                        <div style={slideStyles.innerCard}></div>
                    </div>

                    <div
                        style={slideStyles.card}
                        onMouseEnter={e => e.currentTarget.style = { ...slideStyles.card, ...slideStyles.cardHover }}
                        onMouseLeave={e => e.currentTarget.style = slideStyles.card}
                    >
                        <div></div>
                        <div style={slideStyles.innerCard}></div>
                    </div>

                    <div
                        style={slideStyles.card}
                        onMouseEnter={e => e.currentTarget.style = { ...slideStyles.card, ...slideStyles.cardHover }}
                        onMouseLeave={e => e.currentTarget.style = slideStyles.card}
                    >
                        <div>give us your feedback!</div>
                        <div style={slideStyles.innerCard}></div>
                    </div>

                    <div
                        style={slideStyles.card}
                        onMouseEnter={e => e.currentTarget.style = { ...slideStyles.card, ...slideStyles.cardHover }}
                        onMouseLeave={e => e.currentTarget.style = slideStyles.card}
                    >
                        <div></div>
                        <div style={slideStyles.innerCard}></div>
                    </div>
                </div>
            </div>
        );
    };

    return (
        <div className="flex w-screen flex-col max-w-full overflow-x-hidden">
            {/* top slide of home page  */}
            <div className="w-screen h-screen bg-blue-100 overflow-hidden relative flex flex-col place-items-center place-content-center">
                <div className="z-20 text-indigo-900 2xl:text[14rem] xl:text-[12rem] lg:text-[10rem] md:text-[7rem] text-[3.5rem] flex font-semibold italic font-['Newsreader']">
                    Milliken SAC
                </div>
                <div className="z-20 w-4/6 md:flex pb-10 hidden text-neutral-800 text-center text-xs md:text-sm lg:text-lg xl:text-xl font-['Inter']">
                    Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aliquam euismod nisl et ultrices accumsan. Vivamus tincidunt eleifend sodales. Donec at libero quis nunc luctus porttitor vel quis dolor.
                </div>
                <div className="gradient1"></div>
                <div className="gradient2"></div>
                <div className="gradient3"></div>
            </div>

            {/* Second Slide of Home Page */}
            <SecondSlide />

            {/* third slide of home page */}
            <div className="w-screen h-screen flex max-w-full justify-center items-center">
                <div className="w-10/12 h-5/6 place-self-center grid grid-cols-2 grid-rows-2 gap-x-40 gap-y-5 bg-gradient-to-b from-indigo-50 to-indigo-100 rounded-[20px]">
                    <div className="w-[20rem] h-[18rem] flex flex-col justify-self-end self-end">
                        <div className="pl-3 pt-6 text-black text-[2.1rem] italic font-semibold font-['Newsreader']">Section Description</div>
                        <div className="px-3 mt-5 text-black text-[0.69rem] font-normal font-['Inter'] leading-normal">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</div>
                    </div>
                    <div className="w-[20rem] h-[18rem] flex shrink justify-self-start self-end bg-white rounded-[30px] shadow-xl"></div>
                    <div className="w-[20rem] h-[18rem] flex shrink justify-self-end self-start bg-white rounded-[30px] shadow-xl"></div>
                    <div className="w-[20rem] h-[18rem] flex flex-col">
                        <div className="pl-3 pt-6 text-black text-[2.1rem] italic font-semibold font-['Newsreader']">Section Description</div>
                        <div className="px-3 mt-5 text-black text-[0.69rem] font-normal font-['Inter'] leading-normal">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Home;
